      mrb_raisef(mrb, E_TYPE_ERROR, "expected argument to be %S, %S given", mrb_str_new_cstr(mrb, mrb_obj_classname(mrb, self)), mrb_str_new_cstr(mrb, mrb_obj_classname(mrb, other)));
